Description, female
(n = 1): Idiosoma rounded-oval (
Fig. 264
), light purple-greyish, posterior part of dorsal ridge dark purple, secondary sclerotization brownish-yellow; dorsal shield oval, anteriorly slightly tapering, posteriorly broadly rounded (
Fig. 265
) (L/W 589/471), ridge on dorsal shield apically strongly tapering, antero-lateral margin straight, outline of posterior two third nearly rectangular, Dgl-3 to -5 with strong setae, Dgl-6 and Lgl-4 with small setae, Dgl-3, Lgl-4 and Dgl-6 far lateral, Dgl-4 and -5 further medial; soft integument in dorsal furrow lined (
Fig. 265
); ventral shield oval-rounded (L/W 657/579); coxal field relatively short, broad, anteriorly surpassing ventral shield; capitular bay shallow, broad, medial margin Cx-I long (88), Cx-III rather short (54) (
Fig. 264
); Cxgl-2 at lateral margin of coxal field between Cx-II and -III, Cxgl-4 at anterior margin of Cx-III (relatively far lateral); caudal margin of Cx-IV rounded, caudo-laterally concave, near Vgl-3 indented, laterally flat convex, dorso-laterally extended towards dorsal of Cx-III, lateral ridge +/- straight (
Fig. 264
); genital field mid-sized, trapezoid, towards rostral clearly tapering, anteriorly rounded, laterally convex, posterior truncated (L/W 146/135), caudally extended beyond genital bay; acetabula relatively large, elongated-oval (Ac1 and Ac3 slightly remote from anterior and caudal end of genital flaps respectively), setae on genital flaps minute (
Fig. 264
); setae of Vgl-1 far posterior to caudal corner of Cx-IV (straight posterior to Vgl-3), Vgl-3 close to caudo-lateral margin of Cx-IV; excretory pore remote from caudal margin, Vgl-2 close to caudal margin, Vgl-4 and Lgl-1 to -3 at lateral and caudal margin of ventral shield; legs moderately compact, leg-I to -III with relatively strong setae, claws smoothly curved with fine, single dorsal clawlet and relatively short comb-like ventral clawlets, distal segments of leg-I and -II extended, leg-I and -II relatively short, leg-III and -IV longer (
Figs 266-269
); leg-IV with many strong setae, especially dense rows of setae ventrally on leg-IV-5 and -6, leg-IV-6 terminal with two mid-sized and one small setae and sub-terminal with row of long, strong ventral setae (
Fig. 269
); base of capitulum compact, rostrum ventro-distally extended by large, beaver-tail-shaped keel, dorsal apodemes very small, ventral apodemes short and high, ventral margin proximally inflated, towards rostrum straight (
Fig. 270
); chelicera relatively slender; proximal segments of palp compact; P2 ventrally straight, medial with sharp pointed ventro-distal corner, dorsal margin proximally strongly curved with one latero-dorsal and five medio-dorsal setae, mainly concentrated in proximal corner, ventral seta far latero-distally, pointed (
Figs 270, 271
); P3 with two medio-dorsal and one lateral setae, medio-distal extended; P4 short, small, with long, hair-like ventro-distal setae (one very long) and fine protrusion, inserted more lateral at P3; P5 very long and slender, only one relatively fine distal claw (
Figs 270, 271
).
